import * as React from "react";
import { ButtonGroup } from "@mui/material";
import { Checkbox } from "@mui/material";
import { TextField } from "@mui/material";
import './Stylesheets/LoginForm.css';
import { Stack, Paper, Grid, Button, Box } from "@mui/material";

function LoginForm(){
    return <Box spacing={6} display="flex" flexDirection="column" justifyContent="center" alignItems="stretch"><TextField margin="normal" variant="standard" size="small"></TextField>
                              <TextField margin="normal" xs={50} variant="standard" size="small"></TextField></Box>;
}

export default LoginForm;
